import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';
import { 
  UserGroupIcon, 
  UserIcon, 
  ClipboardDocumentListIcon, 
  CalendarDaysIcon,
  MagnifyingGlassIcon,
  ChartBarIcon,
  InformationCircleIcon
} from '@heroicons/react/24/outline';

interface DashboardData {
  patients: {
    total: number;
    age_distribution: Array<{_id: string; count: number}>;
    gender_distribution: Array<{_id: string; count: number}>;
  };
  doctors: {
    total: number;
    available: number;
    specialization_distribution: Array<{_id: string; count: number}>;
    department_distribution: Array<{_id: string; count: number}>;
    experience_distribution: Array<{_id: number; count: number}>;
  };
  appointments: {
    total: number;
    today: number;
    this_week: number;
    this_month: number;
    status_distribution: Array<{_id: string; count: number}>;
    recent: Array<{
      id: string;
      patient_name: string;
      doctor_name: string;
      appointment_date: string;
      status: string;
    }>;
  };
  today_schedule: Array<{
    id: string;
    patient_name: string;
    doctor_name: string;
    appointment_date: string;
    status: string;
    duration_minutes: number;
  }>;
  summary: {
    total_entities: number;
    active_today: number;
    available_doctors: number;
  };
}

interface Patient {
  id: string;
  patient_id: string;
  full_name: string;
  phone: string | null;
  email: string | null;
  date_of_birth: string | null;
  gender: string | null;
  address: string | null;
  medical_history: string[];
  allergies: string[];
  medications: string[];
  appointment_count: number;
  last_appointment: string | null;
  upcoming_appointments: Array<{
    id: string;
    doctor_name: string;
    appointment_date: string;
    status: string;
  }>;
}

interface Doctor {
  id: string;
  doctor_id: string;
  full_name: string;
  specialization: string;
  department: string;
  phone: string | null;
  email: string | null;
  years_experience: number | null;
  consultation_fee: number | null;
  is_available: boolean;
  appointment_stats: {
    total_appointments: number;
    upcoming_appointments: number;
    status_breakdown: {[key: string]: number};
  };
  next_appointments: Array<{
    id: string;
    patient_name: string;
    appointment_date: string;
    status: string;
  }>;
}

interface Appointment {
  id: string;
  patient_name: string;
  patient_phone: string | null;
  doctor_name: string;
  appointment_date: string;
  duration_minutes: number;
  status: string;
  notes: string | null;
  patient_details?: {
    full_name: string;
    email: string | null;
    gender: string | null;
    allergies: string[];
    medications: string[];
  };
  doctor_details?: {
    full_name: string;
    specialization: string;
    department: string;
    consultation_fee: number | null;
  };
}

const Dashboard: React.FC = () => {
  const [dashboardData, setDashboardData] = useState<DashboardData | null>(null);
  const [patients, setPatients] = useState<Patient[]>([]);
  const [doctors, setDoctors] = useState<Doctor[]>([]);
  const [appointments, setAppointments] = useState<Appointment[]>([]);
  const [activeTab, setActiveTab] = useState<'overview' | 'patients' | 'doctors' | 'appointments'>('overview');
  const [loading, setLoading] = useState(false);
  const [searchQuery, setSearchQuery] = useState('');

  const fetchDashboardData = async () => {
    try {
      setLoading(true);
      const response = await fetch('http://localhost:8000/api/dashboard/overview');
      if (response.ok) {
        const data = await response.json();
        setDashboardData(data);
      }
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
    } finally {
      setLoading(false);
    }
  };

  const fetchPatients = async () => {
    try {
      setLoading(true);
      const url = searchQuery 
        ? `http://localhost:8000/api/dashboard/patients/details?search=${encodeURIComponent(searchQuery)}`
        : 'http://localhost:8000/api/dashboard/patients/details';
      
      const response = await fetch(url);
      if (response.ok) {
        const data = await response.json();
        setPatients(data.patients);
      }
    } catch (error) {
      console.error('Error fetching patients:', error);
    } finally {
      setLoading(false);
    }
  };

  const fetchDoctors = async () => {
    try {
      setLoading(true);
      const url = searchQuery 
        ? `http://localhost:8000/api/dashboard/doctors/details?search=${encodeURIComponent(searchQuery)}`
        : 'http://localhost:8000/api/dashboard/doctors/details';
      
      const response = await fetch(url);
      if (response.ok) {
        const data = await response.json();
        setDoctors(data.doctors);
      }
    } catch (error) {
      console.error('Error fetching doctors:', error);
    } finally {
      setLoading(false);
    }
  };

  const fetchAppointments = async () => {
    try {
      setLoading(true);
      const url = searchQuery 
        ? `http://localhost:8000/api/dashboard/appointments/details?patient_search=${encodeURIComponent(searchQuery)}`
        : 'http://localhost:8000/api/dashboard/appointments/details';
      
      const response = await fetch(url);
      if (response.ok) {
        const data = await response.json();
        setAppointments(data.appointments);
      }
    } catch (error) {
      console.error('Error fetching appointments:', error);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchDashboardData();
  }, []);

  useEffect(() => {
    if (activeTab === 'patients') {
      fetchPatients();
    } else if (activeTab === 'doctors') {
      fetchDoctors();
    } else if (activeTab === 'appointments') {
      fetchAppointments();
    }
  }, [activeTab, searchQuery]);

  const formatDate = (dateString: string) => {
    const date = new Date(dateString);
    return date.toLocaleDateString() + ' ' + date.toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' });
  };

  const getStatusColor = (status: string) => {
    const colors = {
      'scheduled': 'bg-blue-100 text-blue-800',
      'completed': 'bg-green-100 text-green-800',
      'cancelled': 'bg-red-100 text-red-800',
      'no-show': 'bg-gray-100 text-gray-800',
      'in-progress': 'bg-yellow-100 text-yellow-800'
    };
    return colors[status as keyof typeof colors] || 'bg-gray-100 text-gray-800';
  };

  if (loading && !dashboardData) {
    return (
      <div className="flex items-center justify-center min-h-screen">
        <div className="animate-spin rounded-full h-32 w-32 border-b-2 border-blue-500"></div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-50 p-6">
      <div className="max-w-7xl mx-auto">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          className="mb-8"
        >
          <h1 className="text-3xl font-bold text-gray-900 mb-2">DocTalk AI Dashboard</h1>
          <p className="text-gray-600">Comprehensive medical practice management</p>
        </motion.div>

        {/* Tab Navigation */}
        <div className="mb-6">
          <nav className="flex space-x-8">
            {[
              { key: 'overview', label: 'Overview', icon: ChartBarIcon },
              { key: 'patients', label: 'Patients', icon: UserGroupIcon },
              { key: 'doctors', label: 'Doctors', icon: UserIcon },
              { key: 'appointments', label: 'Appointments', icon: CalendarDaysIcon }
            ].map(({ key, label, icon: Icon }) => (
              <button
                key={key}
                onClick={() => setActiveTab(key as any)}
                className={`flex items-center space-x-2 px-4 py-2 rounded-lg font-medium transition-colors ${
                  activeTab === key
                    ? 'bg-blue-100 text-blue-700 border-b-2 border-blue-500'
                    : 'text-gray-600 hover:text-gray-900 hover:bg-gray-100'
                }`}
              >
                <Icon className="w-5 h-5" />
                <span>{label}</span>
              </button>
            ))}
          </nav>
        </div>

        {/* Overview Tab */}
        {activeTab === 'overview' && dashboardData && (
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            className="space-y-6"
          >
            {/* Summary Cards */}
            <div className="grid grid-cols-1 md:grid-cols-4 gap-6">
              <div className="bg-white p-6 rounded-xl shadow-sm border border-gray-200">
                <div className="flex items-center">
                  <UserGroupIcon className="w-8 h-8 text-blue-500" />
                  <div className="ml-4">
                    <p className="text-sm font-medium text-gray-600">Total Patients</p>
                    <p className="text-2xl font-bold text-gray-900">{dashboardData.patients.total}</p>
                  </div>
                </div>
              </div>
              
              <div className="bg-white p-6 rounded-xl shadow-sm border border-gray-200">
                <div className="flex items-center">
                  <UserIcon className="w-8 h-8 text-green-500" />
                  <div className="ml-4">
                    <p className="text-sm font-medium text-gray-600">Available Doctors</p>
                    <p className="text-2xl font-bold text-gray-900">{dashboardData.doctors.available}</p>
                  </div>
                </div>
              </div>
              
              <div className="bg-white p-6 rounded-xl shadow-sm border border-gray-200">
                <div className="flex items-center">
                  <CalendarDaysIcon className="w-8 h-8 text-purple-500" />
                  <div className="ml-4">
                    <p className="text-sm font-medium text-gray-600">Today's Appointments</p>
                    <p className="text-2xl font-bold text-gray-900">{dashboardData.appointments.today}</p>
                  </div>
                </div>
              </div>
              
              <div className="bg-white p-6 rounded-xl shadow-sm border border-gray-200">
                <div className="flex items-center">
                  <ClipboardDocumentListIcon className="w-8 h-8 text-orange-500" />
                  <div className="ml-4">
                    <p className="text-sm font-medium text-gray-600">Total Appointments</p>
                    <p className="text-2xl font-bold text-gray-900">{dashboardData.appointments.total}</p>
                  </div>
                </div>
              </div>
            </div>

            {/* Today's Schedule */}
            <div className="bg-white rounded-xl shadow-sm border border-gray-200">
              <div className="p-6 border-b border-gray-200">
                <h3 className="text-lg font-semibold text-gray-900">Today's Schedule</h3>
              </div>
              <div className="p-6">
                {dashboardData.today_schedule.length === 0 ? (
                  <p className="text-gray-500 text-center py-8">No appointments scheduled for today</p>
                ) : (
                  <div className="space-y-4">
                    {dashboardData.today_schedule.map((appointment) => (
                      <div key={appointment.id} className="flex items-center justify-between p-4 bg-gray-50 rounded-lg">
                        <div>
                          <p className="font-medium text-gray-900">{appointment.patient_name}</p>
                          <p className="text-sm text-gray-600">{appointment.doctor_name}</p>
                        </div>
                        <div className="text-right">
                          <p className="text-sm font-medium">{formatDate(appointment.appointment_date)}</p>
                          <span className={`inline-block px-2 py-1 rounded-full text-xs font-medium ${getStatusColor(appointment.status)}`}>
                            {appointment.status}
                          </span>
                        </div>
                      </div>
                    ))}
                  </div>
                )}
              </div>
            </div>

            {/* Statistics */}
            <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
              {/* Patient Age Distribution */}
              <div className="bg-white rounded-xl shadow-sm border border-gray-200 p-6">
                <h3 className="text-lg font-semibold text-gray-900 mb-4">Patient Age Distribution</h3>
                <div className="space-y-2">
                  {dashboardData.patients.age_distribution.map((item) => (
                    <div key={item._id} className="flex justify-between">
                      <span className="text-sm text-gray-600">{item._id}</span>
                      <span className="text-sm font-medium">{item.count}</span>
                    </div>
                  ))}
                </div>
              </div>

              {/* Doctor Specializations */}
              <div className="bg-white rounded-xl shadow-sm border border-gray-200 p-6">
                <h3 className="text-lg font-semibold text-gray-900 mb-4">Doctor Specializations</h3>
                <div className="space-y-2">
                  {dashboardData.doctors.specialization_distribution.map((item) => (
                    <div key={item._id} className="flex justify-between">
                      <span className="text-sm text-gray-600">{item._id}</span>
                      <span className="text-sm font-medium">{item.count}</span>
                    </div>
                  ))}
                </div>
              </div>

              {/* Appointment Status */}
              <div className="bg-white rounded-xl shadow-sm border border-gray-200 p-6">
                <h3 className="text-lg font-semibold text-gray-900 mb-4">Appointment Status</h3>
                <div className="space-y-2">
                  {dashboardData.appointments.status_distribution.map((item) => (
                    <div key={item._id} className="flex justify-between">
                      <span className={`text-sm px-2 py-1 rounded-full ${getStatusColor(item._id)}`}>
                        {item._id}
                      </span>
                      <span className="text-sm font-medium">{item.count}</span>
                    </div>
                  ))}
                </div>
              </div>
            </div>
          </motion.div>
        )}

        {/* Search Bar for detail tabs */}
        {activeTab !== 'overview' && (
          <div className="mb-6">
            <div className="relative">
              <MagnifyingGlassIcon className="absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-400 w-5 h-5" />
              <input
                type="text"
                placeholder={`Search ${activeTab}...`}
                className="pl-10 pr-4 py-2 w-full border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-transparent"
                value={searchQuery}
                onChange={(e) => setSearchQuery(e.target.value)}
              />
            </div>
          </div>
        )}

        {/* Patients Tab */}
        {activeTab === 'patients' && (
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            className="bg-white rounded-xl shadow-sm border border-gray-200"
          >
            <div className="p-6 border-b border-gray-200">
              <h3 className="text-lg font-semibold text-gray-900">Patient Details</h3>
            </div>
            <div className="p-6">
              {loading ? (
                <div className="text-center py-8">
                  <div className="animate-spin rounded-full h-8 w-8 border-b-2 border-blue-500 mx-auto"></div>
                </div>
              ) : patients.length === 0 ? (
                <p className="text-gray-500 text-center py-8">No patients found</p>
              ) : (
                <div className="grid grid-cols-1 gap-6">
                  {patients.map((patient) => (
                    <div key={patient.id} className="border border-gray-200 rounded-lg p-6">
                      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                        <div>
                          <h4 className="text-lg font-semibold text-gray-900 mb-2">{patient.full_name}</h4>
                          <div className="space-y-2 text-sm">
                            <p><span className="font-medium">Patient ID:</span> {patient.patient_id}</p>
                            <p><span className="font-medium">Phone:</span> {patient.phone || 'N/A'}</p>
                            <p><span className="font-medium">Email:</span> {patient.email || 'N/A'}</p>
                            <p><span className="font-medium">Gender:</span> {patient.gender || 'N/A'}</p>
                            <p><span className="font-medium">DOB:</span> {patient.date_of_birth ? new Date(patient.date_of_birth).toLocaleDateString() : 'N/A'}</p>
                          </div>
                        </div>
                        <div>
                          <h5 className="font-medium text-gray-900 mb-2">Medical Information</h5>
                          <div className="space-y-2 text-sm">
                            <div>
                              <span className="font-medium">Allergies:</span>
                              <p className="text-gray-600">{patient.allergies.length > 0 ? patient.allergies.join(', ') : 'None'}</p>
                            </div>
                            <div>
                              <span className="font-medium">Medications:</span>
                              <p className="text-gray-600">{patient.medications.length > 0 ? patient.medications.join(', ') : 'None'}</p>
                            </div>
                            <div>
                              <span className="font-medium">Total Appointments:</span>
                              <p className="text-gray-600">{patient.appointment_count}</p>
                            </div>
                            <div>
                              <span className="font-medium">Last Appointment:</span>
                              <p className="text-gray-600">{patient.last_appointment ? formatDate(patient.last_appointment) : 'None'}</p>
                            </div>
                          </div>
                        </div>
                      </div>
                      
                      {patient.upcoming_appointments.length > 0 && (
                        <div className="mt-4 pt-4 border-t border-gray-200">
                          <h5 className="font-medium text-gray-900 mb-2">Upcoming Appointments</h5>
                          <div className="space-y-2">
                            {patient.upcoming_appointments.map((appt) => (
                              <div key={appt.id} className="flex justify-between items-center text-sm bg-gray-50 p-2 rounded">
                                <span>{appt.doctor_name}</span>
                                <span>{formatDate(appt.appointment_date)}</span>
                                <span className={`px-2 py-1 rounded-full ${getStatusColor(appt.status)}`}>
                                  {appt.status}
                                </span>
                              </div>
                            ))}
                          </div>
                        </div>
                      )}
                    </div>
                  ))}
                </div>
              )}
            </div>
          </motion.div>
        )}

        {/* Doctors Tab */}
        {activeTab === 'doctors' && (
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            className="bg-white rounded-xl shadow-sm border border-gray-200"
          >
            <div className="p-6 border-b border-gray-200">
              <h3 className="text-lg font-semibold text-gray-900">Doctor Details</h3>
            </div>
            <div className="p-6">
              {loading ? (
                <div className="text-center py-8">
                  <div className="animate-spin rounded-full h-8 w-8 border-b-2 border-blue-500 mx-auto"></div>
                </div>
              ) : doctors.length === 0 ? (
                <p className="text-gray-500 text-center py-8">No doctors found</p>
              ) : (
                <div className="grid grid-cols-1 gap-6">
                  {doctors.map((doctor) => (
                    <div key={doctor.id} className="border border-gray-200 rounded-lg p-6">
                      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                        <div>
                          <div className="flex items-center mb-2">
                            <h4 className="text-lg font-semibold text-gray-900">{doctor.full_name}</h4>
                            <span className={`ml-2 px-2 py-1 rounded-full text-xs ${doctor.is_available ? 'bg-green-100 text-green-800' : 'bg-red-100 text-red-800'}`}>
                              {doctor.is_available ? 'Available' : 'Unavailable'}
                            </span>
                          </div>
                          <div className="space-y-2 text-sm">
                            <p><span className="font-medium">Doctor ID:</span> {doctor.doctor_id}</p>
                            <p><span className="font-medium">Specialization:</span> {doctor.specialization}</p>
                            <p><span className="font-medium">Department:</span> {doctor.department}</p>
                            <p><span className="font-medium">Phone:</span> {doctor.phone || 'N/A'}</p>
                            <p><span className="font-medium">Email:</span> {doctor.email || 'N/A'}</p>
                            <p><span className="font-medium">Experience:</span> {doctor.years_experience ? `${doctor.years_experience} years` : 'N/A'}</p>
                            <p><span className="font-medium">Consultation Fee:</span> {doctor.consultation_fee ? `$${doctor.consultation_fee}` : 'N/A'}</p>
                          </div>
                        </div>
                        <div>
                          <h5 className="font-medium text-gray-900 mb-2">Appointment Statistics</h5>
                          <div className="space-y-2 text-sm">
                            <p><span className="font-medium">Total Appointments:</span> {doctor.appointment_stats.total_appointments}</p>
                            <p><span className="font-medium">Upcoming Appointments:</span> {doctor.appointment_stats.upcoming_appointments}</p>
                          </div>
                          
                          {Object.keys(doctor.appointment_stats.status_breakdown).length > 0 && (
                            <div className="mt-3">
                              <h6 className="font-medium text-gray-700 mb-1">Status Breakdown:</h6>
                              <div className="space-y-1">
                                {Object.entries(doctor.appointment_stats.status_breakdown).map(([status, count]) => (
                                  <div key={status} className="flex justify-between text-xs">
                                    <span className={`px-2 py-1 rounded ${getStatusColor(status)}`}>{status}</span>
                                    <span>{count}</span>
                                  </div>
                                ))}
                              </div>
                            </div>
                          )}
                        </div>
                      </div>
                      
                      {doctor.next_appointments.length > 0 && (
                        <div className="mt-4 pt-4 border-t border-gray-200">
                          <h5 className="font-medium text-gray-900 mb-2">Next Appointments</h5>
                          <div className="space-y-2">
                            {doctor.next_appointments.map((appt) => (
                              <div key={appt.id} className="flex justify-between items-center text-sm bg-gray-50 p-2 rounded">
                                <span>{appt.patient_name}</span>
                                <span>{formatDate(appt.appointment_date)}</span>
                                <span className={`px-2 py-1 rounded-full ${getStatusColor(appt.status)}`}>
                                  {appt.status}
                                </span>
                              </div>
                            ))}
                          </div>
                        </div>
                      )}
                    </div>
                  ))}
                </div>
              )}
            </div>
          </motion.div>
        )}

        {/* Appointments Tab */}
        {activeTab === 'appointments' && (
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            className="bg-white rounded-xl shadow-sm border border-gray-200"
          >
            <div className="p-6 border-b border-gray-200">
              <h3 className="text-lg font-semibold text-gray-900">Appointment Details</h3>
            </div>
            <div className="p-6">
              {loading ? (
                <div className="text-center py-8">
                  <div className="animate-spin rounded-full h-8 w-8 border-b-2 border-blue-500 mx-auto"></div>
                </div>
              ) : appointments.length === 0 ? (
                <p className="text-gray-500 text-center py-8">No appointments found</p>
              ) : (
                <div className="space-y-4">
                  {appointments.map((appointment) => (
                    <div key={appointment.id} className="border border-gray-200 rounded-lg p-6">
                      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
                        <div>
                          <h4 className="text-lg font-semibold text-gray-900 mb-2">Appointment Details</h4>
                          <div className="space-y-2 text-sm">
                            <p><span className="font-medium">Patient:</span> {appointment.patient_name}</p>
                            <p><span className="font-medium">Doctor:</span> {appointment.doctor_name}</p>
                            <p><span className="font-medium">Date & Time:</span> {formatDate(appointment.appointment_date)}</p>
                            <p><span className="font-medium">Duration:</span> {appointment.duration_minutes} minutes</p>
                            <div className="flex items-center">
                              <span className="font-medium mr-2">Status:</span>
                              <span className={`px-2 py-1 rounded-full text-xs ${getStatusColor(appointment.status)}`}>
                                {appointment.status}
                              </span>
                            </div>
                          </div>
                        </div>
                        
                        {appointment.patient_details && (
                          <div>
                            <h5 className="font-medium text-gray-900 mb-2">Patient Information</h5>
                            <div className="space-y-2 text-sm">
                              <p><span className="font-medium">Phone:</span> {appointment.patient_phone || 'N/A'}</p>
                              <p><span className="font-medium">Email:</span> {appointment.patient_details.email || 'N/A'}</p>
                              <p><span className="font-medium">Gender:</span> {appointment.patient_details.gender || 'N/A'}</p>
                              <div>
                                <span className="font-medium">Allergies:</span>
                                <p className="text-gray-600">{appointment.patient_details.allergies.length > 0 ? appointment.patient_details.allergies.join(', ') : 'None'}</p>
                              </div>
                            </div>
                          </div>
                        )}
                        
                        {appointment.doctor_details && (
                          <div>
                            <h5 className="font-medium text-gray-900 mb-2">Doctor Information</h5>
                            <div className="space-y-2 text-sm">
                              <p><span className="font-medium">Specialization:</span> {appointment.doctor_details.specialization}</p>
                              <p><span className="font-medium">Department:</span> {appointment.doctor_details.department}</p>
                              <p><span className="font-medium">Consultation Fee:</span> {appointment.doctor_details.consultation_fee ? `$${appointment.doctor_details.consultation_fee}` : 'N/A'}</p>
                            </div>
                          </div>
                        )}
                      </div>
                      
                      {appointment.notes && (
                        <div className="mt-4 pt-4 border-t border-gray-200">
                          <h5 className="font-medium text-gray-900 mb-2">Notes</h5>
                          <p className="text-sm text-gray-600">{appointment.notes}</p>
                        </div>
                      )}
                    </div>
                  ))}
                </div>
              )}
            </div>
          </motion.div>
        )}
      </div>
    </div>
  );
};

export default Dashboard;
